import { NewInvoiceFooter } from '../InvoiceDetails/InvoiceDetails';

const NewFormContainer = () => {
    const form = {
        'id': '',
        'createdAt': '',
        'paymentDue': '',
        'description': '',
        'paymentTerms': null,
        'clientName': '',
        'clientEmail': '',
        'status': '',
        'senderAddress': {
            'street': '',
            'city': '',
            'postCode': '',
            'country': '',
        },
        'clientAddress': {
            'street': '',
            'city': '',
            'postCode': '',
            'country': ''
        },
        'items': [],
    }


    return (
        <>
            <div className='New-Form-Wrapper'>
                <FormData form={form} />
            </div>
            <NewInvoiceFooter  />
        </>
    );
};




export default NewFormContainer;
